import "./PersonalInfo.css";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import { makeStyles } from "@material-ui/core/styles";
import TextField from "@material-ui/core/TextField";
import NavButtons from "../NavButtons/NavButtons.jsx";

const useStyles = makeStyles((theme) => ({
  root: {
    "& > *": {
      marginTop: theme.spacing(2),
      width: "50ch",
    },
  },
}));

const PersonalInfo = (props) => {
  const classes = useStyles();
  const { step, setStep, maxSteps } = props;

  return (
    <div>
      <Card className="card">
        <CardContent>
          <form className={classes.root} autoComplete="on">
            <TextField label="Name" variant="outlined" required />
            <TextField label="E-mail" variant="outlined" required />
            <TextField label="Phone Number" variant="outlined" required />
          </form>
        </CardContent>
      </Card>

      <Card className="card">
        <CardContent>
          <form className={classes.root} autoComplete="on">
            <TextField label="GitHub URL" variant="outlined" />
            <TextField label="LinkedIn URL" variant="outlined" />
            <TextField label="Website URL" variant="outlined" />
          </form>
        </CardContent>
      </Card>
      <NavButtons />
    </div>
  );
};

export default PersonalInfo;
